import React from "react";
import "../App.css";

function Home() {
  return (
    <div className="tavernepic" style={{ position: 'relative', width: '100%', height: '100vh' }}>
      <img
        src="/images/taverne2.jpg"
        alt="Background Image"
        style={{ width: '100%', height: '100%', objectFit: 'cover' }}
      />
      <a href="/Beasts" style={{ position: 'absolute', top: '20%', left: '30%', width: '20%', height: '20%' }} />
      <a href="/Dicegame" style={{ position: 'absolute', top: '50%', left: '40%', width: '20%', height: '20%' }} />
      <a href="/Map" style={{ position: 'absolute', top: '70%', left: '50%', width: '20%', height: '20%' }} />
    </div>
  );
}


export default Home;
